li:nth-child(2) > .rbx-menu-item {
  	visibility: hidden;
	position: relative;
  }
li:nth-child(2) > .rbx-menu-item:before {
	visibility: visible;
	position: center;
	top: 0;
	left: 0;
	content: "Buy Tix";
      }
#buy-robux-popover-menu > li:nth-child(4) {
  	visibility: hidden;
	position: relative;
  }
#buy-robux-popover-menu > li:nth-child(4):after {
	visibility: visible;
	position: absolute;
	top: 0;
	left: 0;
	content: "";
}
